window.bookSummaryJSON = "<p><b>She knows where to find the body </b></p> <p>When Raina Hamish tries on a dress in a Miami boutique, she has a terrifyingly accurate vision of a murdered corpse in the murky shadows of the Everglades. She wants to help, but who would believe her when she can hardly believe herself? </p> <p>Special Agent Axel Tiger has returned to Florida to help hunt a serial killer, but the investigation doesn’t have much to go on. Raina’s vision is their best chance to uncover more. Axel’s experience with the FBI’s elite paranormal team will nurture Raina’s abilities, and she may be able to help save a life - but it puts her directly in the crosshairs of a killer who is closer than they would ever suspect.</p>"; 
